import './SearchForm.css';
import React from 'react';
import searchIcon from '../../images/search-icon.svg';

function SearchForm() {
  return (
    <section className='search-form'>
      <div className='search-form__rectangle'>
        <div className='search-form__search-elements'>
          <img
            className='search-form__search-icon'
            src={searchIcon}
            alt='Иконка поиска'
          />
          <p className='search-form__search-text'>Фильм</p>
        </div>
        <div className='search-form__search-items'>
          <button className='search-form__search-button'>Найти</button>
          <hr className='search-form__search-vr' />
          <label className='search-form__search-tumb' htmlFor="">
            <input type="checkbox" />
            <span className='search-form__tumb-span'></span>
          </label>
          {/* <div className='search-form__search-tumb'></div> */}
          <p className='search-form__search-subtitle'>Короткометражки</p>
        </div>
      </div>
      <hr className='search-form__divider' />
    </section>
  );
}

export default SearchForm;
